import './App.css';
import * as React from 'react';
import { Avatar } from '@mui/material';

function App() {
  return (
    <>
    <div className='div1'>
      <Avatar sx={{ width: "26rem", height: "27rem" }} alt="Remy Sharp" src="https://t2.gstatic.com/licensed-image?q=tbn:ANd9GcQOO0X7mMnoYz-e9Zdc6Pe6Wz7Ow1DcvhEiaex5aSv6QJDoCtcooqA7UUbjrphvjlIc" />
      <Avatar sx={{ width: "26rem", height: "27rem" }} alt="Travis Howard" src="https://estaticos-cdn.prensaiberica.es/clip/823f515c-8143-4044-8f13-85ea1ef58f3a_16-9-discover-aspect-ratio_default_0.jpg" />
      <Avatar sx={{ width: "25rem", height: "27rem" }} alt="Cindy Baker" src="https://images.hola.com/imagenes/mascotas/20190820147813/razas-perros-pequenos-parecen-grandes/0-711-550/razas-perro-pequenos-grandes-m.jpg?tx=w_680" />
    </div>
    </>
  );
}



export default App;
